import './NewTask.css';
import React, { useState } from 'react';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Button from '@material-ui/core/Button';

const NewTask = (props) => {
    const [piority, setPiority] = useState('Normal');

    const handleChange = (event) => {
        setPiority(event.target.value);
    };

    return (
        <div className="container">
            <Typography className="text-new-task">New Task</Typography>
            <TextField className="add-new" id="outlined-basic" placeholder="Add new task" variant="outlined"/>
            <div className="description">
                <Typography>Description</Typography>
                <textarea className="text-description"/>
            </div>
            <div className="option">
                <div>
                    <Typography>Due Date</Typography>
                    <FormControl variant="outlined" size="large" className="date-time">
                        <Select
                            value={piority}
                            onChange={handleChange}
                        >
                            <MenuItem value={'Low'}>Low</MenuItem>
                            <MenuItem value={'Normal'}>Normal</MenuItem>
                            <MenuItem value={'High'}>High</MenuItem>
                        </Select>
                    </FormControl>
                </div>
                <div>
                    <Typography>Piority</Typography>
                    <FormControl variant="outlined" size="large" className="piority">
                        <Select
                            value={piority}
                            onChange={handleChange}
                        >
                            <MenuItem value={'Low'}>Low</MenuItem>
                            <MenuItem value={'Normal'}>Normal</MenuItem>
                            <MenuItem value={'High'}>High</MenuItem>
                        </Select>
                    </FormControl>
                </div>


            </div>
            <Button variant="outlined" id="btn-add">Add</Button>

        </div>
    );
};

export default NewTask;
